import React from "react";
import background from "../Assets/IMG/volvo.jpg";
import {
  FormAutoComponent,
  FormUsuarioComponent,
  TableAutoComponent,
  TableUsuarioComponent,
  ButtonComponents,
} from "../components";

const HomePage = () => {
  return (
    // <div style={
    //     { backgroundImage: `url(${background})` };
    //     { background-repeat: `no-repeat`        };
    //     }>
    <div>
      <img src={background} alt="aaa" style={{ zIndex: 0, width: "100vw" }} />

      <FormAutoComponent />
      <br />
      <FormUsuarioComponent />
      <br />
      <TableAutoComponent />
      <ButtonComponents />
      <br />
      <TableUsuarioComponent />
      <ButtonComponents />
      <br />
    </div>
  );
};
export default HomePage;
